import React from "react"

const Results = props => (
  <div>
    <p id={props.id}>Title: {props.title}
      <br></br>Link: {props.url}
      <button title={props.title} url={props.url} date={props.date} time={props.time} className="btnSave" onClick={event => props.save(event)}>Save</button>
      <br></br>Published on {props.date} at {props.time}</p>
  </div>
);

export default Results;
